/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Props } from 'docz'
import Home from './Home'
import { MDBBtn } from 'mdbreact'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};
const Playground = makeShortcode("Playground");
const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "homejs"
    }}>{`Home.js`}</h1>
    <h2 {...{
      "id": "mdb-button"
    }}>{`MDB Button`}</h2>
    <Playground __position={0} __code={'<MDBBtn color=\"indigo\">Login</MDBBtn>'} __scope={{
      props: this ? this.props : props,
      Props,
      Home,
      MDBBtn
    }} __codesandbox={`undefined`} mdxType="Playground">
    <MDBBtn color="indigo" mdxType="MDBBtn">Login</MDBBtn>
    </Playground>
    <h2 {...{
      "id": "notes"
    }}>{`Notes`}</h2>
    <blockquote>
      <p parentName="blockquote">{`This .js file is the homepage for Pi_oT, where any user can either
use the log in or sign up functions to log into the protected pages.
Uses HTML with a MDBBtn from MDB Bootstrap. `}</p>
    </blockquote>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
